import { createStore } from 'vuex'
import { SignedPdf } from '@/models/signedPdf'
import { ref } from 'vue';

const store = createStore({
    state() {
        return {
            signatures: [
                {
                    id: 1,
                    name: 'John Doe',
                    signature: `data:image/png;base64,`,
                },
                {
                    id: 2,
                    name: 'Jane Doe',
                    signature: `data:image/png;base64,`,
                },
            ],
            pdfs: [
                {
                    id: '1',
                    name: 'pdf1',
                    url: 'https://www.w3.org/WAI/ER/tests/xhtml/testfiles/resources/pdf/dummy.pdf',
                    description: 'This is a test pdf file',
                    signed: false,
                },
                {
                    id: '2',
                    name: 'pdf2',
                    url: `data:application/pdf;base64,`,
                    description: 'This is a test pdf file',
                    signed: false,
                },
            ],
            signedPdfs: <SignedPdf[]>([
                
            ]),
        }
    },
    mutations: {
        addPdf(state, pdf) {
            const newpdf = {
                id: new Date().toISOString(),
                name: pdf.name,
                url: pdf.url,
                description: pdf.description,
                signed: false,
            }
            state.pdfs.unshift(newpdf);
        },
        saveSignature(state, signature) {
            const signatureObj = {
                id: new Date().getTime(),
                name: signature.name,
                signature: signature.signature,
            }
            state.signatures.unshift(signatureObj)
        },
        deleteSignature(state, signatureId) {
            const signatureIndex = state.signatures.findIndex(
                (signature) => signature.id === signatureId
            )
            state.signatures.splice(signatureIndex, 1)
        },
        signPdf(state, data) {
            const pdfIndex = state.pdfs.findIndex((pdf) => pdf.id === data.pdfId)
            state.pdfs[pdfIndex].signed = true
            const signedPdf = {
                pdfId: data.pdfId,
                signature: data.signature,
                page: data.page,
                position: {
                    x: data.position.x,
                    y: data.position.y,
                },
            }
            state.signedPdfs.push(new SignedPdf(signedPdf.pdfId, signedPdf.signature, signedPdf.page, signedPdf.position))

        },
        deleteSignatureFromPdf(state, data) {
            const signedPdfIndex = state.signedPdfs.findIndex((signedPdf) => signedPdf.pdfId === data.pdfId && signedPdf.signature === data.signature)
            state.signedPdfs.splice(signedPdfIndex, 1)
            const pdfIndex = state.pdfs.findIndex((pdf) => pdf.id === data.pdfId)
            state.pdfs[pdfIndex].signed = false
        }

    },
    actions: {
        addPdf(context, pdf) {
            context.commit('addPdf', pdf)
        },
        saveSignature(context, signature) {
            context.commit('saveSignature', signature)
        },
        deleteSignature(context, signatureId) {
            context.commit('deleteSignature', signatureId)
        },
        signPdf(context, data) {
            context.commit('signPdf', data)
        },
        deleteSignatureFromPdf(context, data) {
            context.commit('deleteSignatureFromPdf', data)
        }

    },
    getters: {
        Pdfs(state) {
            return state.pdfs;
        },
        Pdf(state) {
            return (pdfId: string) => {
                return state.pdfs.find((pdf) => {
                    return pdf.id === pdfId;
                })
            }
        },
        signatures(state) {
            return state.signatures
        },
        signature(state) {
            return (signatureId: number) => {
                return state.signatures.find((signature) => signature.id === signatureId)
            }
        },
        signedPdfs(state) {
            return state.signedPdfs
        },

    }
})
export default store